"use strict";

function maxSubarraySumCircular(nums) {
    let s1 = nums[0], s2 = nums[0], f1 = nums[0], f2 = nums[0];
    for (let i = 1; i < nums.length; i++) {
        let num = nums[i];
        f1 = num + Math.max(f1, 0);
        f2 = num + Math.min(f2, 0);
        s1 = Math.max(s1, f1);
        s2 = Math.min(s2, f2);
    }
    return s1 <= 0 ? Math.max(s1, s2) : Math.max(s1, (nums.reduce((a, b) => a + b, 0) - s2));
}
